- input: "TEXT\x1CC00035600\x1CX0\x1C\x1CF3XA\x1CThis is in response to the FEC letter
    dated 4/23/13.  #1 None of the funds received by a national party committee were
    earmarked for any exempt activities.  In addition, the committee fully complied
    with all other requirements of the exempt activity rules, including the use of
    volunteers.  #2  Please note that none of the funds received from the 'Democratic
    Congressional Campaign Committee and the DNC Services Corporation/Democratic National
    Committee' were used for the Federal share of allocable Federal Election activity.
    \ The Committee maintains a separate bank account in which party transfers are
    deposited.  This account is never used to pay for allocable federal election activity.
    \ The transfers from the Democratic National Committee were corrected and appear
    on Line 12.   In addition, the Committee paid its employees with 100% federal
    funds and disclosed the expenditures on Line 30b when the individual spent more
    than 25% of their compensated time in a given month on Federal Election Activity
    or activities in connection with a Federal Election.  Those individuals who spent
    25% or less of their compensated time in a given month on FEA or activities in
    connection with a Federal Election were paid with Federal funds and allocated
    on Schedule H4.  In either case, all amounts spent for employee specific 'fringe
    benefits,' consisting of health insurance, disability insurance, life insurance,
    retirement benefits and payroll taxes were paid for and reported on a proportional
    basis equal to the amount associated with the individual that received the compensation
    and the funds with which the individual was paid.  Any reimbursements/allocation
    transfers to the Committee's federal account from the Committee's non-federal
    account for salaries and/or benefits were associated with individuals whose activities
    do not exceed 25% in a given month.  Receipts reported on Schedule A for Line
    17, unless otherwise noted, were for the purchase of access to the Committee's
    voter file.  The Committee believed this price properly reflected the fair market
    value of the file, which represented the normal charge for such data in our state.
    \ All costs associated with the voter file were paid 100% out of the federal account
    and were therefore not allocable.  Payments listed on Schedule H4 for office supplies
    were payments either to vendors or reimbursements to individuals for basic supplies
    used for day-to-day operations.  These items included, but were not limited to
    pens, paper, paper clips, pencils, ink, toner, video tapes, CDs, cups, toilet
    paper, paper towels, tissues, trash bags, coffee, tape, extension cords, light
    bulbs, labels, folders, organizers, envelopes, soap, cleaning products, etc...\n"
